Dinosaur Bird (Ch4)

Science Documentary hosted by Mark Evans and Simon Watt, published by Channel 4 broadcasted as part of CH4 Inside Nature's Giants series in 2011 - English narration


Information
------------------------------

Inside Natures Giants returns to Australia on the trail of a bird that's been described as a living dinosaur. The cassowary hides in Queensland's tropical rainforests. It's a gigantic bird with a fearsome reputation. It can be taller and heavier than a full-grown man and is armed with five-inch talons that have actually killed humans. The cassowary has earned the dubious reputation of being the most dangerous bird in the world, yet unless it feels threatened, it struts quietly around the jungle and, occasionally, coastal areas. With a bright blue head that's adorned with a horn-like crown, and red pendulums of flesh dangling from its neck, this is, by any standards, a bizarre bird.
Mark Evans and Joy Reidenberg carry out a dissection on a cassowary that was hit by a car. Unfortunately, such accidents are quite common on roads that cut through their territory. The team investigate the mystery of how it produces its deep resonant mating call, how it evolved to have such stunted wings and such sharp talons, and the extraordinary breathing apparatus of this giant bird.
Simon Watt goes on the trail of its distant cousins to discover the close links with meat-eating dinosaurs that have left their footprints in the mud of dried up rivers.

